INSERT INTO `reviews` (`id`, `user_id`, `body`, `rating`, `target_id`, `target_type`, `created_at`) VALUES (1, 156, 'Qui sint magnam molestiae asperiores pariatur. Et omnis est tempore est perferendis. Quia quod nulla sit mollitia impedit iusto. Quae adipisci unde ut pariatur commodi sed. Consequatur nihil tenetur quo saepe cum.', '3', 175, 'Объект размещения', '2020-01-05 11:39:19');
INSERT INTO `reviews` (`id`, `user_id`, `body`, `rating`, `target_id`, `target_type`, `created_at`) VALUES (2, 30, 'Reiciendis omnis non laboriosam quam aut fuga. Incidunt quibusdam quasi consectetur totam consequatur. Voluptate libero voluptatem et ut voluptatem blanditiis. Sint alias voluptatum veritatis nesciunt exercitationem.', '3', 219, 'Объект размещения', '2012-09-15 21:53:39');
INSERT INTO `reviews` (`id`, `user_id`, `body`, `rating`, `target_id`, `target_type`, `created_at`) VALUES (3, 150, 'Qui ipsa dolor consequatur. Repellat voluptatem non beatae ea. Quia est quam dolore voluptate et autem. Nihil repudiandae adipisci laborum aliquam.', '4', 137, 'Объект размещения', '2014-07-03 06:01:15');
INSERT INTO `reviews` (`id`, `user_id`, `body`, `rating`, `target_id`, `target_type`, `created_at`) VALUES (4, 88, 'Cupiditate totam quibusdam fugit eos blanditiis molestias et vel. Vel voluptas porro enim. Nostrum nihil rerum incidunt magnam distinctio.', '4', 117, 'Гость', '2001-01-16 17:07:35');
INSERT INTO `reviews` (`id`, `user_id`, `body`, `rating`, `target_id`, `target_type`, `created_at`) VALUES (5, 169, 'Voluptatem omnis ut non doloribus. Reprehenderit eum delectus ipsum incidunt iste esse. Aliquam totam quia voluptatem voluptatem esse dolor.', '3', 179, 'Гость', '2018-08-30 10:34:51');
