-- скрипты наполнения БД данными;
#
# TABLE STRUCTURE FOR: bookings
#


CREATE TABLE `bookings` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя, забронировавшего объект',
  `property_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на объект размещения',
  `start_date` date NOT NULL COMMENT 'Дата начала бронирования',
  `end_date` date NOT NULL COMMENT 'Дата окончания бронирования',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Бронирования';



#
# TABLE STRUCTURE FOR: cities
#


CREATE TABLE `cities` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `city_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название города',
  `country_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на страну',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Города';



#
# TABLE STRUCTURE FOR: countries
#


CREATE TABLE `countries` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `country_name` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название страны',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `country_name` (`country_name`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: messages
#


CREATE TABLE `messages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `from_user_id` int(10) unsigned NOT NULL COMMENT 'Отправитель сообщения',
  `to_user_id` int(10) unsigned NOT NULL COMMENT 'Получатель сообщения',
  `body` varchar(2500) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Текст',
  `is_delivered` tinyint(1) DEFAULT NULL COMMENT 'Признак доставки',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Сообщения';



#
# TABLE STRUCTURE FOR: owners
#


CREATE TABLE `owners` (
  `id` int(10) unsigned NOT NULL COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL PRIMARY KEY COMMENT 'Ссылка на пользователя',
  `super_owner` tinyint(1) DEFAULT NULL COMMENT 'Флаг суперхозяина',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки'
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Собственники жилья';



#
# TABLE STRUCTURE FOR: photos
#


CREATE TABLE `photos` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя, который загрузил файл',
  `filename` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Путь к файлу',
  `size` int(11) NOT NULL COMMENT 'Размер файла',
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Метаданные файла' CHECK (json_valid(`metadata`)),
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Фотографии';



#
# TABLE STRUCTURE FOR: profiles
#


CREATE TABLE `profiles` (
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `photo_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на основную фотографию пользователя',
  `gender` enum('m','w') COLLATE utf8_unicode_ci NOT NULL COMMENT 'Пол',
  `birthday` date NOT NULL COMMENT 'Дата рождения',
  `country_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на страну',
  `city_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на город',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  UNIQUE KEY `photo_id` (`photo_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Профили';



#
# TABLE STRUCTURE FOR: property
#


CREATE TABLE `property` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `owner_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на собственника жилья',
  `country_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на страну',
  `city_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на город',
  `address` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Адрес',
  `title` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название объекта',
  `description` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Описание',
  `accomodation` enum('Жилье целиком','Отдельная комната','Место в комнате') COLLATE utf8_unicode_ci DEFAULT NULL,
  `property_type` enum('Квартира','Дом','Уникальное жилье') COLLATE utf8_unicode_ci DEFAULT NULL,
  `capacity` tinyint(4) DEFAULT NULL COMMENT 'Вместимость',
  `price` decimal(11,2) unsigned NOT NULL COMMENT 'Стоимость одного дня',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Объекты размещения';



#
# TABLE STRUCTURE FOR: property_photos
#


CREATE TABLE `property_photos` (
  `property_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на объект размещения',
  `photo_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на фотографию',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`property_id`,`photo_id`) COMMENT 'Составной первичный ключ'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Фотографии жилья';



#
# TABLE STRUCTURE FOR: reviews
#


CREATE TABLE `reviews` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя, который оставил отзыв',
  `body` varchar(1200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Текст отзыва',
  `rating` enum('1','2','3','4','5') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Оценка',
  `target_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на конкретную строку, которой был оставлен отзыв',
  `target_type` enum('Гость','Объект размещения') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Кому был оставлен отзыв',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Отзывы';



#
# TABLE STRUCTURE FOR: users
#


CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `email` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Телефон',
  `is_owner` tinyint(1) DEFAULT NULL COMMENT 'Флаг собственника',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Пользователи';



